{-# OPTIONS_GHC -Wall #-}
  module Prototype.ObjBinGen  (phpObjServices)
  where
 
   import CommonClasses
   import Data.Fspec
   import Prototype.ConnectToDataBase   (connectToDataBase)
   import Prototype.Object              (objectServices)
   import Prototype.Wrapper             (objectWrapper)
   import Prototype.Installer           (installer)
   import Prototype.InterfaceDef        (interfaceDef)
   import Prototype.Index               (htmlindex)
   import Prototype.RelBinGenBasics     (addSlashes)
   import Prototype.ContextGen          (contextGen)
   import System.FilePath               
   import System.Directory
   import Options hiding (services)
   import Control.Monad
 
   phpObjServices :: Fspc -> Options -> IO()
   phpObjServices fSpec flags
     =   verboseLn flags "---------------------------"
      >> verboseLn flags "Generating php Object files with ADL"
      >> verboseLn flags "---------------------------"
      >> verboseLn flags ("  Generating index.htm")
      >> writeFile (combine targetDir "index.htm")
                   (htmlindex fSpec serviceObjects flags)
      >> verboseLn flags ("  Generating Installer.php")
      >> writeFile (combine targetDir "Installer.php")
                   (installer fSpec flags)
      >> verboseLn flags ("  Generating "++name fSpec++".php")
      >> writeFile (combine targetDir (name fSpec++".php"))
                   (contextGen fSpec)
      >> verboseLn flags ("  Generating interfaceDef.inc.php")
      >> writeFile (combine targetDir "interfaceDef.inc.php")
                   (interfaceDef fSpec serviceObjects (dbName flags))
      >> verboseLn flags ("  Generating connectToDataBase.inc.php")
      >> writeFile (combine targetDir "connectToDataBase.inc.php")
                   (connectToDataBase fSpec flags)
      >> writeWhenNotExist (combine targetDir "edit.js") edit
      >> verboseLn flags ("  Writing Static file: navigate.js")
      >> writeWhenNotExist (combine targetDir "navigate.js") navigate
      >> verboseLn flags ("  Writing Static file: jquery-1.3.2.min.js")
      >> writeWhenNotExist (combine targetDir "jquery-1.3.2.min.js") jquery
      >> verboseLn flags ("  Writing Static file: style.css")
      >> writeWhenNotExist (combine targetDir "style.css") stylesheet
      >> createDirectoryIfMissing True cssDir
      >> writeWhenNotExist (combine cssDir "screen.css") css_screen
      >> writeWhenNotExist (combine cssDir "reset.css") css_reset
      >> createDirectoryIfMissing True fontsDir
      >> writeWhenNotExist (combine fontsDir "myriad_pro_700.font.js") myriad_pro_700_font_js
      >> createDirectoryIfMissing True imagesDir
      >> writeWhenNotExist (combine imagesDir "aldProtoLogo.jpg") images_aldProtoLogo_jpg
      >> writeWhenNotExist (combine imagesDir "images_add.gif") images_add_gif
      >> writeWhenNotExist (combine imagesDir "images_button.gif") images_button_gif
      >> writeWhenNotExist (combine imagesDir "images_del.gif") images_del_gif
      >> writeWhenNotExist (combine imagesDir "images_edit.gif") images_edit_gif
      >> writeWhenNotExist (combine imagesDir "images_header_bg.jpg") images_header_bg_jpg
      >> writeWhenNotExist (combine imagesDir "images_header_decoration.jpg") images_header_decoration_jpg
      >> writeWhenNotExist (combine imagesDir "images_menu_bg.jpg") images_menu_bg_jpg
      >> createDirectoryIfMissing True jsDir
      >> writeWhenNotExist (combine jsDir "js_cufon-yui.js") js_cufon_yui_js
      >> (if sqlLogPwdDefd flags then -- if either login or password for SQL has been specified then make a dbsettings file
             verboseLn flags ("  Writing username and password: dbsettings.php")
          >> writeFile (combine targetDir "dbsettings.php") dbsettings
          else
             verboseLn flags ("  Skipping dbsettings.php (Installer.php will create this file)")
         )
      >> verboseLn flags ("Includable files for all objects:")
      >> sequence_
         [ verboseLn flags ("  Generating "++addExtension (name o) ".inc.php")
           >> writeFile (combine targetDir (addExtension (name o) ".inc.php")) 
                        (objectServices flags fSpec o)
         | o <- serviceObjects
         ]
      >> verboseLn flags ("Wrapper files for all objects:")
      >> sequence_
         [ verboseLn flags ("  Generating "++addExtension (name o) ".php")
           >> writeFile (combine targetDir (addExtension (name o) ".php"))
                        (objectWrapper fSpec o)
         | o <- serviceObjects
         ]
      >> verboseLn flags ("\n")
      where
       dbsettings = "<?php $DB_link=mysql_connect("
                    ++  "$DB_host='"++addSlashes (sqlHost flags)++"'"
                    ++", $DB_user='"++addSlashes (sqlLogin flags)++"'"
                    ++", $DB_pass='"++addSlashes (sqlPwd flags)++"'"
                    ++") or exit(\"Username / password are probably incorrect. Try deleting dbsettings.php\"); $DB_debug = 3; ?>"
       targetDir = dirPrototype flags
       writeWhenNotExist :: FilePath -> String -> IO()
       writeWhenNotExist fp str 
          = do exists <- doesFileExist fp 
               when exists
                   (do verboseLn flags ("  Writing Static file: "++fp)
                       writeFile fp str)
       cssDir = combine targetDir "css"
       fontsDir = combine targetDir "fonts"
       imagesDir = combine targetDir "images"
       jsDir = combine targetDir "js"
       serviceObjects = serviceG fSpec++serviceS fSpec -- serviceS come from the ADL-script. serviceG generates additional services.
       -- to place a file, first open it
       -- replace \ by \\, turn on grep and replace \n, \n and " by \\n, \\n and \\" respectively
       -- replace the line below with .. = "", and paste (you cannot edit long lines in most editors)
       -- I have not tried this method with binary files (eg files containing backspace,NUL,etc)
       -- will not work with UTF8 symbols
       -- OR do it with Haskell, try something like this:
       --    let fnFull = yourFileName in
       --    do deTekst <- readFile fnFull
       --       writeFile (addExtension fnFull ".oneliner") ("writeFile "++fnFull++" "++show deTekst)
                    
      -- stylesheet = "td,h3,a,p,body{\n  font-size  : 12pt;\n  color      : black;\n  font-family: Helvetica;\n}\nbody{\n  background-color : #EEE;\n}\n.hidden{\n  border-style   : hidden;\n  border-collapse: collapse;\n  padding        : 0;\n  margin         : 0;\n  border         : 0;\n}\n.cNotice a{\n  text-decoration: none;\n  color          : #3A5B7E;\n}\n.cNotice{\n  clear: both;\n}\nhtml,body{\n  margin : 0;\n  padding: 0;\n  height : 100%;\n  border : none\n}\n.Floater {\n  border:1px;\n  border-style: dotted;\n  border-collapse:collapse;\n  background-color: #FFFFFF;\n  margin:5px;\n  margin-top:22px;\n  padding:5px;\n  float:left;\n}\n\n.content{\n  clear:both;\n  padding:12px;\n  display:block;\n}\n\n.Goto{\n  position: absolute;\n  display: none;\n}\n.GotoArrow, .x{\n  float: right;\n  width : 20px;\n  height : 20px;\n}\n.GotoLink{\n  text-decoration: none;\n  border-bottom: 3px double;\n  cursor:pointer;\n}\n\n.Goto ul,.menuDiv ul, ul.buttons{\n  list-style: none;\n  display:block;\n  clear:both;\n  padding: 2px;\n}\n.menuDiv li, .buttons li\n{\n  display: block;\n  float: left;\n  padding: 2px;\n}\n.menu li a, .buttons li a, .Goto li a\n{\n  width: 130px;\n  padding: 5px;\n}\n\n.menu li a:hover,.buttons li a:hover,.Goto li a:hover,.GotoArrow:hover,#x:hover{\n  background-color: #def;\n  border: 1px solid #89b;\n}\n\n.menu li a,.buttons li a, .Goto li a, .GotoArrow, #x{\n  display: block;\n  cursor: pointer;\n  user-select: none;\n  border: 1px solid #abc;\n  text-align: center;\n  vertical-align: middle;\n  color         : #0A2B5E;\n  background-color: #cde;\n}\n\ndiv.item{\n  width:100%;\n}\n.item,.new{\n  margin:0px;\n  padding:3px;\n/*  width:100%; This puts the bullet at the end of a bulleted item, instead of the beginning*/\n}\n.Edit .item, .Edit .new{\n  cursor:pointer;\n}\n.Edit .hover,.Edit .hover{\n  background-color: #9999FF\n}\n\n.HolderContent {\n  border:1px;\n  border-style: solid;\n  border-collapse:collapse;\n  margin:0px;\n  padding:0px;\n}\n.Holder{padding:5px;}\nul {\n  margin: 0px;\n  padding: 0px 0px 0px 15px;\n  list-style-position: outside;\n  text-indent: 0px;\n}\np { margin: 2px; }\n.FloaterHeader {\n  font-size: 11px;\n  background-color: #FFFFFF;\n  margin-top: -22px;\n  position: relative;\n  display: block;\n  clear:both;\n  overflow: show;\n  border-style: dotted dotted solid dotted;\n  border-width: 1px;\n  border-color:black black white black;\n  border-collapse: collapse;\n  padding:3px 3px 0px 3px;\n}\n\n#errorPopup{\n  background-color: #FF5;\n}"
       edit = "// JavaScript (c) by Bas Joosten 2009\n// requires jQuer 1.3+\n\nvar editbox = document.createElement(\"input\"); // an input box for user interaction\neditbox.setAttribute(\"id\",\"editbx\");\neditbox.setAttribute(\"name\",\"editbx\");\neditbox.setAttribute(\"type\",\"text\");\nvar editObject=null; // current editing object. Null for none\nvar editContent=null; // the old value, used to restore the object, should we undo the edit\n// editsNew tells whether the current editing object (ie editObject!=null) is new.\n// This is used to answer these questions:\n// should 'tab' give a new element?\n// should unEdit(false) destroy the element?\nvar editsNew=false;\n// tabHover is the current element we're hovering over, using the mouse or tab-key\nvar tabHover=null; // code to set it is written at the 'attatch hover/click events'\n\n\n///////////////////////\n//                   //\n//   save function   //\n//                   //\n///////////////////////\nfunction save(url,id){ // id can be used as an extra parameter, to set the ID value\n  $('#errorPopup').remove(); // remove the previous error, if still present\n  var all=$(\".item\").get();\n  var flds=new Array();\n  for(var i=0;i<all.length;i++){\n    var o=$(all[i]);\n    if(o.is(':has(.item,.new)')){ // are there any nested attributes?\n      var inp=$('input[name='+o.attr('id')+'.ID]');\n      if(inp.is(\"*\")) // does it exist?\n        flds[i]=o.attr('id')+'='+escape(inp.val());\n      else flds[i]=o.attr('id')+'='; // no id, but still set\n    }else\n    flds[i]=o.attr('id')+'='+escape(o.text());\n  }\n  if(id!=null) flds[flds.length]='ID='+id;\n  $.post(url,flds.join('&'),function recieveDataOnPost(data){\n    var splitdata = data.split('ok:');\n    if(splitdata.length==2){ // data is saved, follow URL (to exit edit mode)\n      document.location.href=splitdata[1];\n    } else {\n      // create a error popup, and place it in the DOM immediately\n      $('<DIV id=\\\"errorPopup\\\"><DIV id=\\\"x\\\">x</DIV><DIV id=\\\"error\\\">'+data+'</DIV></DIV>').prependTo('.content:first').hide().slideDown();\n      // add the functionality to the 'x' button\n      $('#x').click(function(){\n        $('#errorPopup').slideUp(function(me){$('#errorPopup').remove();});\n      });\n    }\n  });\n}\n\n\n//////////////////////////\n//                      //\n//   Editing function   //\n//                      //\n//////////////////////////\nfunction edit(obj){\n    if(obj==null) return;\n    editsNew=false;\n    if(tabHover!=null) $(tabHover).removeClass('hover');\n    // get the UI class function\n    cls = getUIClass(obj);\n    if($(obj).is('.new')){\n        ////////////////////\n        //   create new   //\n        ////////////////////\n        if($(obj).is('div'))\n          editObject=obj;\n        else{\n          editsNew=true;\n          editObject=$(obj).clone().insertBefore(obj);\n          var nrs=$(obj).attr('id').split('.');\n          nrs[nrs.length-1]-=-1; // add one numerically\n          $(obj).attr('id',nrs.join('.'));\n        }\n        if(eval('typeof '+cls)=='function'){\n          ///////////////////////////////\n          //   create complex object   //\n          //  and edit its first item  //\n          //                           //\n          editsNew=false;\n          $(editObject).html(eval(cls+'(\\''+$(editObject).attr('id')+'\\')'));\n          reassign($(editObject).find(\".new,.item\"));\n          reassign($(editObject));\n          firstObj=$(editObject).find('.item:not(:has(.item,.new))').eq(0);\n          edit(firstObj);\n          $(editObject).removeClass(\"new\");\n          $(editObject).addClass(\"item\");\n          //                           //\n          // unfortunately, the cancel //\n          //   key won't work so well  //\n          ///////////////////////////////\n        }else{\n          ///////////////////////////////\n          // create a new leaf-element //\n          //        and edit it        //\n          reassign(editObject);\n          editBoxIt(editObject).value='';\n          $(editObject).removeClass(\"new\");\n          $(editObject).addClass(\"item\");\n        }\n    }else{\n        //////////////////////\n        //   edit current   //\n        //////////////////////\n        if(eval('typeof '+cls)=='function'){ // remove the item (since we can create a new one!)\n          if(!$(obj).is('li')){ // not a list item: create my own 'New'\n            var newitm=$('<DIV class=\"new '+cls+'\" id=\"'+$(obj).attr('id')+'\"><i>Nothing</i></DIV>');\n            $(obj).replaceWith(newitm);\n            reassign(newitm);\n          }else{\n            remove(obj);\n          }\n        } else {\n          var txt=$(obj).text();\n          editBoxIt(obj).value=txt;\n        }\n    }\n}\n////////////////////////////////////////\n//                                    //\n//..and the function to stop editing  //\n//                                    //\n////////////////////////////////////////\nfunction unEdit(submit,reset){ if(reset==null) reset=true;\n    if(editObject==null) return false;\n    $(editObject).addClass('hover');\n    tabHover=editObject;\n    $(editObject).empty();\n    if(!submit) editbox.value=editContent;\n    if(editbox.value==''){\n        if($(editObject).is('li')) {\n          var obj=$(editObject);\n          editObject=prev(obj,\".item:not(:has(.item,.new))\");\n          // the line below ensures the next item won't be \"new\" again: move on to next field\n          // comment the line to get blocking behaviour\n          // editsNew=false;\n          remove(obj);\n        }else{\n          if($(editObject).is('div')){\n              var cls=getUIClass(editObject);\n              var id=$(editObject).attr('id');\n              var newitm=$('<DIV class=\"new '+cls+'\" id=\"'+id+'\"><i>Nothing</i></DIV>');\n              $(editObject).replaceWith(newitm);\n              reassign(newitm);\n          } // in other cases, the object is a SPAN, which cannot be empty!\n        }\n    }else $(editObject).text(editbox.value);\n    if(reset) editObject=null;\n}\n\nfunction remove(obj){\n    var nrs = $(obj).attr('id').split('.');\n    var i=nrs.pop()-0;\n    var start=nrs.join('.');\n    var jstart=nrs.join('\\\\.');\n    if(nrs.length){ start+='.'; jstart+='\\\\.'; }\n    for(i++;$('#'+jstart+i).attr('id')!=null;i++){\n      $('#'+jstart+i).attr('id',start+(i-1));\n    }\n    $(obj).remove();\n}\n\n// change the item into an editbox, and ensure it is possible to change it back later\nfunction editBoxIt(obj){\n    editObject=obj;\n    if($(obj).is('.item')) editContent=$(obj).get(0).innerHTML; else editContent='';\n    $(obj).empty();\n    $(obj).append(editbox);\n    editbox.focus();\n    $(tabHover).removeClass('hover');\n    setTimeout('uneditBlur();',1);\n    $(editbox).blur(function blurEditbox(){\n      $(editbox).focus();\n      return false;\n    });\n    return editbox;\n}\nfunction uneditBlur(){\n    $(editbox).blur(function blurEditbox(){\n      unEdit(true);\n    });\n}\nfunction getUIClass(obj){\n    var classes=$(obj).attr('class').split(' ');\n    for(var i=0;i<classes.length;i++){\n      if(classes[i].substr(0,2)==\"UI\") return classes[i];\n    }\n    return '';\n}\n\n//////////////////////////////////////\n//                                  //\n//   attatch hover / click events   //\n//                                  //\n//////////////////////////////////////\nfunction reassign(objs){\n   $(objs).hover(\n     function hover_over(){\n       if(editObject==null){\n           if($(this).not(\":has(.hover)\").addClass('hover').is(\".item,.new\")){\n              if(tabHover!==this) $(tabHover).removeClass('hover');\n              tabHover=this;\n           }\n           $(this).parents().removeClass('hover');\n       }\n     }\n     ,\n     function hover_out(){\n       if(editObject==null){\n         $(this).removeClass('hover');\n         if($(this).parents(\".item\").eq(0).addClass('hover').is(\".item,.new\")){\n           if(tabHover!=$(this).parent().get(0)) $(tabHover).removeClass('hover');\n           tabHover=$(this).parents(\".item\").eq(0);\n         }\n       }\n     }\n     );\n   $(objs).click(\n      function click(){ if($(this).is(\".hover\") && editObject==null) edit(this);\n                      }\n   );\n}\n\n\n/////////////////////////\n//                     //\n//   document onload   //\n//                     //\n/////////////////////////\n$(function documentLoad() {\n   reassign(\".item,.new\");\n   $('form').submit(function formSubmitCatch(){\n     return false;\n   }\n   );\n   /////////////////////////\n   //   keyboard events   //\n   /////////////////////////\n   document.onkeydown=function (e) {\n      var kC;\n      var shift;\n      if (\"which\" in e)\n      {// NN4 & FF &amp; Opera\n        kC=e.which;\n        shift=e.shiftKey;\n      } else if (\"keyCode\" in e)\n      {// Safari & IE4+\n        kC=e.keyCode;\n        shift=e.shiftKey;\n      } else if (\"keyCode\" in window.event)\n      {// IE4+\n        kC=window.event.keyCode;\n        shift=window.event.shiftKey;\n      } else if (\"which\" in window.event)\n      {\n        kC=window.event.which;\n        shift=window.event.shiftKey;\n      }\n      var Esc = (window.event) ? 27 : e.DOM_VK_ESCAPE;\n      if(kC==13){//Br\n        if(editObject==null && tabHover!=null && $(tabHover).is(\".hover\"))\n        edit(tabHover);\n        else if(editObject!=null) unEdit(true);\n        else{\n          // show a dialog to save the entire page ?\n        }\n      }else\n      if(kC==Esc)\n        {\n          if(editObject==null){ $(tabHover).removeClass('hover'); tabHover=null}\n          unEdit(false);\n        }\n      else\n      if(kC==9){//Tab\n        if(editObject!=null){\n            unEdit(true,false);\n            var search=\".item:not(:has(.item,.new))\";\n            // search=\"(.item,.new):not(:has(.item,.new))\" doesn't work due to a jQuer bug\n            // however, .item:not(:has(.item,.new)),.new:not(:has(.item,.new)) will work\n            // but we can use code below since .new never :has(.item,.new)\n            if(editsNew){ search=\".item:not(:has(.item,.new)),.new\";}\n            first=true;\n            if(shift) editObject=prev($(editObject),search);\n            else editObject=next($(editObject),search);\n            edit(editObject.get(0));\n        }else{\n            tabHover=$(tabHover);\n            tabHover.removeClass('hover');\n            var search=\".new,.item\";\n            if(shift) tabHover=prev(tabHover,search).get(0);\n            else tabHover=next(tabHover,search).get(0);\n            $(tabHover).addClass('hover');\n        }\n      }\n      else {return true;}\n      return false;\n    };\n});\n\n\n///////////////////////////////\n//                           //\n//   some helper functions   //\n//                           //\n///////////////////////////////\nfunction next(obj,search){\n  if(obj.find(search).length){\n    return obj.find(search).eq(0);\n  }\n  var nxt;\n  while((nxt=obj.next()).length==0){\n    if(obj.parent().length) obj=obj.parent();\n    else return next($(\"body\"),search);\n  }\n  if(nxt.is(search)) return nxt\n  return next(nxt,search);\n}\nfunction prev(obj,search){\n  while(obj.prev().length) {\n    obj = obj.prev();\n    var all=obj.find(search);\n    if(all.length) return all.eq(all.length-1);\n    if(obj.is(search)) return obj;\n  }\n  var all=obj.parent();\n  if(all.is(search)) return all;\n  if(all.length) return prev(all,search);\n  var all=$(\"body\").find(search)\n  return all.eq(all.length-1);\n}"
