       stylesheet = "td,h3,a,p,body{\r  font-size  : 12pt;\r  color      : black;\r  font-family: Helvetica;\r}\rbody{\r  background-color : #EEE;\r}\r.hidden{\r  border-style   : hidden;\r  border-collapse: collapse;\r  padding        : 0;\r  margin         : 0;\r  border         : 0;\r}\r.cNotice a{\r  text-decoration: none;\r  color          : #3A5B7E;\r}\r.cNotice{\r  clear: both;\r}\rhtml,body{\r  margin : 0;\r  padding: 0;\r  height : 100%;\r  border : none\r}\r.Floater {\r  border:1px;\r  border-style: dotted;\r  border-collapse:collapse;\r  background-color: #FFFFFF;\r  margin:5px;\r  margin-top:22px;\r  padding:5px;\r  float:left;\r}\r\r.content{\r  clear:both;\r  padding:12px;\r  display:block;\r}\r\r.Goto{\r  position: absolute;\r  display: none;\r}\r.GotoArrow, .x{\r  float: right;\r  width : 20px;\r  height : 20px;\r}\r.GotoLink{\r  text-decoration: none;\r  border-bottom: 3px double;\r  cursor:pointer;\r}\r\r.Goto ul,.menuDiv ul, ul.buttons{\r  list-style: none;\r  display:block;\r  clear:both;\r  padding: 2px;\r}\r.menuDiv li, .buttons li\r{\r  display: block;\r  float: left;\r  padding: 2px;\r}\r.menu li a, .buttons li a, .Goto li a\r{\r  width: 130px;\r  padding: 5px;\r}\r\r.menu li a:hover,.buttons li a:hover,.Goto li a:hover,.GotoArrow:hover,#x:hover{\r  background-color: #def;\r  border: 1px solid #89b;\r}\r\r.menu li a,.buttons li a, .Goto li a, .GotoArrow, #x{\r  display: block;\r  cursor: pointer;\r  user-select: none;\r  border: 1px solid #abc;\r  text-align: center;\r  vertical-align: middle;\r  color         : #0A2B5E;\r  background-color: #cde;\r}\r\rdiv.item{\r  width:100%;\r}\r.item,.new{\r  margin:0px;\r  padding:3px;\r  width:100%;\r}\r.Edit .item, .Edit .new{\r  cursor:pointer;\r}\r.Edit .hover,.Edit .hover{\r  background-color: #9999FF\r}\r\r.HolderContent {\r  border:1px;\r  border-style: solid;\r  border-collapse:collapse;\r  margin:0px;\r  padding:0px;\r}\r.Holder{padding:5px;}\rul {\r  margin: 0px;\r  padding: 0px 0px 0px 15px;\r  list-style-position: outside;\r  text-indent: 0px;\r}\rp { margin: 2px; }\r.FloaterHeader {\r  font-size: 11px;\r  background-color: #FFFFFF;\r  margin-top: -22px;\r  position: relative;\r  display: block;\r  clear:both;\r  overflow: show;\r  border-style: dotted dotted solid dotted;\r  border-width: 1px;\r  border-color:black black white black;\r  border-collapse: collapse;\r  padding:3px 3px 0px 3px;\r}\r\r#errorPopup{\r  background-color: #FF5;\r}"
       css_screen = "/* Standard Elements */\n\nbody { font-family: Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 150%; }\na, a:link { color: #1A9AEA; }\na, a:link, a:hover, a:visited { text-decoration: none; }\na:hover { color: #BF1E74; }\n\nh1 { font-size: 24px; color: #BF1E74; font-weight: bold; line-height: 120%; padding-bottom: 10px; }\nh2, .FloaterHeader { font-size: 18px; color: #253E8A; font-weight: bold; line-height: 120%; }\n\n/* Lay-out */\n\n#container { width: 100%; margin: 0 auto; }\n#container #header { float: left; width: 100%; height: 116px; background: url(../images/header_bg.jpg) repeat-x; }\n#container #header #logo { float: left; display: block; padding: 30px 0 0 20px; }\n#container #header #decoration { float: right; display: block; height: 116px; width: 709px; background: url(../images/header_decoration.jpg) no-repeat; }\n\n#container #menu .primairy { float: left; width: 100%; height: 36px; background: #333333 url(../images/menu_bg.jpg) repeat-x bottom center; }\n#container #menu .primairy ul li a { float: left; display: block; height: 22px; padding: 8px 20px 0 20px; font-size: 16px; color: white; font-weight: bold; }\n#container #menu .primairy ul li a:hover { background: white; color: #BF1E74; height: 28px; }\n#container #menu .primairy ul li a.right { float: right; }\n\n#container #content { clear: both; float: left; padding: 20px; }\n#container #content .Floater { float: left; margin-right: 20px; margin-bottom: 20px; padding: 20px; -moz-border-radius: 5px; border: 1px solid #CDD8DE; }\n#container #content .Floater .FloaterHeader { padding-bottom: 10px; }\n#container #content .Floater .FloaterContent a.GotoLink { border-bottom: 1px dotted #1A9AEA; cursor: pointer; }\n#container #content .Floater .FloaterContent a.GotoLink:hover { border-bottom: 1px dotted #BF1E74; }\n#container #content .Floater .FloaterContent div.Goto { display: none; position: absolute; margin-left: 10px; padding: 10px; -moz-border-radius: 5px; border: 1px solid #CDD8DE; background: white; }\n#container #content .Floater .FloaterContent div.GotoArrow, .x { float: right; display: block; height: 20px; width: 20px; background: white; text-align: center; line-height: 20px; -moz-border-radius: 5px; border: 1px solid #CDD8DE; background: #CDD8DE; cursor: pointer; }\n#container #content .Floater .FloaterContent ul li div.GotoArrowHover, .xHover { background: white; -moz-border-radius: 5px; border: 1px solid #CDD8DE; }\n#container #content .Floater .FloaterContent ul li.item.UI,\n#container #content .Floater .FloaterContent ul li.new.UI { float: left; padding: 0 60px 20px 0; max-width: 200px; }\n#container #content .item, #container #content .new { margin: 0px; padding: 3px; width: 100%; }\n#container #content .Edit .item, #container #content .Edit .new { cursor: pointer; }\n#container #content .Edit .hover { background: #CDD8DE; }\n#container #content .Floater .FloaterContent .hover { background: #CDD8DE; cursor: pointer; }\n\n#container #buttons { width: 90%; clear: both; float: left; padding-left: 20px; }\n#container #buttons ul li a.button { float: left; display: block; width: 120px; height: 30px; background: url(../images/button.gif) no-repeat 0px 0px; line-height: 30px; text-align: center; font-weight: bold; color: #333; margin-right: 20px; }\n#container #buttons ul li a.button:hover { background-position: 0px -30px; color: white; }\n\n#container #notice { clear: both; float: left; padding: 40px 0 0 20px; color: #CDD8DE; }\n\n/* Error */\n#error { display: none; position: absolute; z-index: 1; top: 20px; left: 20px; width: 500px; padding: 10px; border: 1px solid #BF1E74; background: white; }\n#error i { font-size: 14px; color: #BF1E74; font-weight: bold; padding-bottom: 10px; }\n#error .errorClose { float: right; display: block; height: 15px; width: 15px; border: 1px solid #CDD8DE; color: #BF1E74; line-height: 10px; padding: 3px 0 0 7px; }\n#error .errorClose:hover { cursor: pointer; border: 1px solid #BF1E74; }"
